import {
    getCatalog
} from "../../services/api";

import { INITIAL_STATE } from "../initialState";

function reducer(state = INITIAL_STATE, action) {
    switch (action.type) {
        case "GET_PRODUCTS":            
            return {
                ...state,
                products: [],
            };
        default:
            return state;
    }
}


export default reducer;

